import React from 'react';
import Content from './Content';

function Contact() {
	return (


                <div class="row">

                  <div class="col-md-12">
                    <div class="md-form">
                      <textarea id="contact-message" class="form-control md-textarea" rows="3"></textarea>
                      <label for="contact-message">Your message</label>
                    </div>
                  </div>

        
                </div>

        
           

	);
}
export default Contact;
